document.getElementById('convert').addEventListener('click', () => {
  const yearInput = document.getElementById('year').value.trim();
  const weekInput = parseInt(document.getElementById('week').value.trim());

  if (!yearInput || !weekInput) {
    document.getElementById('result').textContent = 'Please provide both year and week number.';
    return;
  }

  // Format the year (handle 2 digits to 4 digits conversion)
  const year = formatYear(yearInput);

  // Default to January if week is 1
  if (weekInput === 1) {
    document.getElementById('result').textContent = `Month: January (Month Number: 1, Week: 1)`;
    return;
  }

  // Search for the month and week
  const result = findMonth(year, weekInput);
  if (result) {
    const monthNumber = monthToNumber[result.month];  // Correctly fetch the month number
    document.getElementById('result').textContent = `Month: ${result.month} Month No: ${monthNumber}`;
  } else {
    document.getElementById('result').textContent = `No data found for Year ${year}.`;
  }
});